import { useEffect, useState } from "react"
import { useParams } from "react-router-dom"
import Prodact from "./prodact";
function ProdactDetetils(){
const usepatrams=useParams()
const[data,setData]=useState([])
useEffect(()=>{
fetch(`https://fakestoreapi.com/products/${usepatrams.Detels}`)
.then(res=>res.json())
.then(data=>setData(data))
})


return(
    <div>
    <h1>THE iD IS Very Well {usepatrams.Detels}</h1>
    <Prodact prodact={data} showbutton />
    </div>


)
}
export default ProdactDetetils
